import './App.css';
import BetTracker from './BetTracker.jsx'
import { useState } from 'react';

const user = "Raphael"

function App() {

  const [page, setPage] = useState('leaderboard')


  return (
    <div className="App">
        <h2>User: {user}</h2>
        {page == 'tracker' && <BetTracker/>}
        {page == 'leaderboard' && <h3>Leaderboard</h3>}
    </div>
  );
}

export default App;
